import React from 'react';
import './car.css'
import {BrowserRouter as Router, Route} from 'react-router-dom'

import MainAnimation from './mainAnimation';
import BottomAnimation from './bottomAnimation'
import PlayerForm from './player'
// import FlagsApi from './api'
import FinalGame from './finalGame'
import './gameBoard.css'


// const Player = props =>
//     <div>
//         <PlayerForm />
//         <FlagsApi />
//     </div>

class App extends React.Component{

    render(){
        let redCar = <img src={require("./imagies/batman_car.png")} style={{
            width:"20%",
            height:"10%"
        }}alt="batman car" className ="fastCar"/>
        let imgPeople= <img src={require("./imagies/person.png")} className ="cell" alt="person"/>
        let people = [imgPeople,imgPeople,imgPeople,imgPeople,imgPeople,imgPeople,imgPeople,imgPeople,imgPeople,imgPeople,imgPeople,imgPeople,imgPeople,
            imgPeople,imgPeople,imgPeople,imgPeople,imgPeople,imgPeople]
        return(
            <div>
            <Router>
                <Route exact path = "/" component={MainAnimation}/>
                <Route exact path='/' render={() => <BottomAnimation  car ={redCar}/> }/>
                <Route exact path ='/player' component={PlayerForm} />
                <Route excact path = '/player/game'render={() => <FinalGame  imgages={people}/> }/>


            </Router>


            </div>
        )
    }
}

export default App;
